import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ height: 300, clear: "both", paddingTop: 20, textAlign: "center", backgroundImage: 'url("background-image.jpg")', backgroundSize: "100%", marginTop: "20px" }}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
